import { all, fork, call, put } from "redux-saga/effects"; //saga의 이펙트 //all은 fork, call을 한번에 실행해준다.

function logInAPI() {
    return axios.post("api/login");
}
export default function* rootSaga() {
    yield all([fork(watchLogin)]);
}
